import React from 'react';
import {TextField, Paper, Grid} from '@mui/material'
/**
 *  Login Main Component
 * 
 */

const login = () => {
    return(
        <Grid container spacing={2}>
            <Grid item xs={12} md={4}>
             <TextField />
            </Grid>
            <Grid item xs={12} md={8}>
            <TextField />
            </Grid>
        </Grid>
    );
}

export default Login;
